CREATE DATABASE VehicleFuelEfficiencyDB;
USE VehicleFuelEfficiencyDB;

CREATE TABLE dim_year (
    year VARCHAR(255),
    year_id INT PRIMARY KEY
);
CREATE TABLE dim_make (
    make VARCHAR(255),
    make_id INT PRIMARY KEY
);
CREATE TABLE dim_model (
    model VARCHAR(255),
    VClass VARCHAR(255),
    model_id INT PRIMARY KEY
);
CREATE TABLE dim_engine (
    displ VARCHAR(255),
    cylinders VARCHAR(255),
    fuelType VARCHAR(255),
    engine_id INT PRIMARY KEY
);
CREATE TABLE fact_vehicle_efficiency (
    vehicle_id INT PRIMARY KEY,
    year_id INT,
    make_id INT,
    model_id INT,
    engine_id INT,
    average_mpg FLOAT,
    fuel_consumption FLOAT,
    co2_emissions FLOAT,
    ghg_score INT,
    FOREIGN KEY (year_id) REFERENCES dim_year(year_id),
    FOREIGN KEY (make_id) REFERENCES dim_make(make_id),
    FOREIGN KEY (model_id) REFERENCES dim_model(model_id),
    FOREIGN KEY (engine_id) REFERENCES dim_engine(engine_id)
);
